import Home from './components/Home';
import CargarPedido from './components/CargarPedido';
import React from 'react';
import {BrowserRouter} from 'react-router-dom';
import {Route, Redirect} from 'react-router-dom';
import './App.css';

function App() {

  const pedidos = [
    {numeroOrden:1,fechaEntrega:'12/05/2021',cantidad:10,cliente:'El diegote',importe: 1200},
    {numeroOrden:2,fechaEntrega:'16/07/2021',cantidad:230,cliente:'Gaspi',importe: 3500}
  ]
  console.log("HOLA");

  return (

      <BrowserRouter>
        <Redirect to="/qChurreria" />
        <Route exact path='/qChurreria' component={(props)=><Home {...props} state={props} {...localStorage.setItem('arrayPedidos', JSON.stringify(pedidos))}/>}/>
        <Route exact path='/cargarPedido' component={()=><CargarPedido/>}/>
      </BrowserRouter>   
  );
}

export default App;
